export default class MyDocument extends Document {
  render () {
    return (

      <html>
        <Head />
        <body>564564654654654
          <Header />
          Hello World!
          <Footer />
          <Main />645564654564564
          <NextScript />
        </body>
      </html>
    )
  }
}
